import React, { FC } from 'react'
import ItemProduct from './ItemProduct'
import { foodType } from '../../../types'
import { useQuery } from 'react-query'
import { productService } from '../../../services'

interface ItemValueProductProps{
  storeOne: boolean,
  storeTwo: boolean,
  storeTree: boolean,

}

const  ItemValueProduct:FC<ItemValueProductProps> = ({storeOne, storeTwo , storeTree }) => {

    const { data: pizzaDay } = useQuery('PizzaDay', () => {
        return productService.getPizzaDay()
      })

      const { data: Kfc } = useQuery('KFC', () => {
        return productService.getKFC()
      })

      const { data: iqPizza } = useQuery('IQpizza ', () => {
        return productService.getIQpizza()
      })


  return (

    <div className='mt-6 grid grid-cols-1 gap-x-6 gap-y-10 sm:grid-cols-2 lg:grid-cols-4 xl:gap-x-8'>


    {storeOne ? (
      pizzaDay?.data.map((product:foodType, id: number) => (
        <ItemProduct key={id} product={product} />
      ))
    ) : (
      <></>
    )}

    {storeTwo ? (
      iqPizza?.data.map((product:foodType, id: number) => <ItemProduct key={id} product={product} />)
    ) : (
      <></>
    )}

    {storeTree ? (
      kfc?.data.map((product:foodType, id: number) => <ItemProduct key={id} product={product} />)
    ) : (
      <></>
    )}
  </div>
  )
}

export default ItemValueProduct
